import classes from "./Cart.module.css";
import Card from "../UI/Card";

const Cart = ()=>{
    return (
        <div className={classes['cart-items']}>
            <Card>
                <ul>
                    <li>Sushi</li>
                    <li>Pani Puri</li>
                </ul>
            </Card>
        </div>
        
    )}

export default Cart;
